const List = ({todos, deleteTodo})  => {
    const complete = () => {
        deleteTodo()
    }
    return (
        <div>
            {todos.map(todo => {
                return (
                    <div key={todo.id}>
                        <button onClick={complete}>完了</button>
                        <span>{todo.content}</span>
                    </div>
                )
            })}
        </div>
    );
}

export default List;
